To achieve this, you can use a combination of `useEffect` and `setTimeout`. Here's an example of how you can modify your code:

```jsx
import React, { useRef, useEffect } from 'react';
import gsap from 'gsap';

const Portfolio = () => {
  const cursor = useRef({ cursorImage: '' }); // assuming cursor is an object with a cursorImage property
  const portfolioCurrent = useRef(null);
  const portfolioNext = useRef(null);

  useEffect(() => {
    if (portfolioCurrent.current && portfolioNext.current) {
      const animate = () => {
